import React from 'react';

import './custom-buttom.styles.scss';


const CustormButtom = ({ children, ...otherProps }) => {
    return (
        <button className="custom-buttom" {...otherProps}
        >
        {children}
        </button>

    );
}

export default CustormeButton;
